%pyspark
from pyspark.sql.functions import (col, udf)
from pyspark.sql.types import (StringType, IntegerType)

def pm10grade(pm):
    if pm <= 30:
        return 1
    elif 30 < pm <= 80:
        return 2
    elif 80 < pm <= 150:
        return 3
    else:
        return 4

def pm25grade(pm):
    if pm <= 15:
        return 1
    elif 15 < pm <= 35:
        return 2
    elif 35 < pm <= 75:
        return 3
    else:
        return 4

udf_pm10grade = udf(classifyPm10, IntegerType())
udf_pm25grade = udf(classifyPm25, IntegerType())
